import React from 'react';
import './App.css';
import ProfileCardContainer from './containers/header/profileCard/profileCardContainer';
import ContactCard from './containers/body/cards/contactCard/contactCard'
function App() {
  const classes = {
    backgroundColor: 'transparent',
  }
  return (
    <div style={classes} >
      <div>
        <ProfileCardContainer />
        <ContactCard />
      </div>
    </div>
  );
}

export default App;
